import React, { Component } from "react";

import { Button, Typography, Container, Paper, Grid } from "@material-ui/core";
import "react-owl-carousel2/lib/styles.css";

const Materi = props => {
  return (
    <Container
      style={{
        flex: "1 0 25%",
        maxWidth: "364px",
        maxHeight: "750px",
        padding: 0,
        backgroundColor: "white",
        margin: "20px 10px",
        borderRadius: "24px",
        textAlign: "center"
      }}
    >
      <Container
        style={{
          position: "relative",
          height: "300px"
        }}
      >
        <img
          style={{
            borderTopLeftRadius: "24px",
            borderTopRightRadius: "24px",
            width: "100%",
            height: "100%"
          }}
          src={props.img}
          alt="image-slidder"
        />
        <Button
          style={{
            backgroundColor: props.color,
            fontWeight: "900",
            borderRadius: "24px",
            color: "white",
            marginBottom: "10px",
            position: "absolute",
            top: 20,
            left: 20
          }}
          href="#"
          variant="contained"
        >
          {props.button}
        </Button>
      </Container>
      <Container
        style={{
          height: "100px"
        }}
      >
        <Typography style={{ color: "#EC9120" }} variant="h4">
          {props.title}
        </Typography>
        <Typography variant="h5">{props.desc}</Typography>
        <Typography variant="body2">{props.harga}</Typography>
      </Container>
    </Container>
  );
};

class Courses extends Component {
  render() {
    return (
      <Container
        style={{
          minHeight: "600px",
          margin: 0,
          padding: 0,
          marginTop: "100px"
        }}
      >
        <Container
          fixed
          style={{
            margin: "20px",
            paddingTop: 20,
            height: "100%",
            borderRadius: "25px",
            backgroundColor: "#F1F0FF"
          }}
        >
          <Typography
            component="h3"
            variant="h4"
            style={{ marginBottom: 10, fontWeight: 700, textAlign: "center" }}
          >
            Schedules
          </Typography>
          <Typography
            component="h1"
            align="center"
            variant="h3"
            style={{ textAlign: "center", color: "#EC9120" }}
          >
            Upcoming Events
          </Typography>
          <Container
            fixed
            style={{ height: "90%", marginTop: 20, width: "100%" }}
          >
            <Container
              style={{
                display: "flex",
                borderRadius: "25px",
                flexWrap: "wrap",
                height: "100%",
                padding: 0,
                marginTop: 20
              }}
            >
              <Materi
                img={require("../images/image1.jpg")}
                title="Quantum Computers"
                desc="Ivan Cornejo"
                harga="10 Lessons"
                button="website"
                color="#50C4EE"
              />
              <Materi
                img={require("../images/image2.jpg")}
                title="Mechanics"
                desc="Chikanso Chima"
                harga="10 Lessons"
                button="design"
                color="#EE71C7"
              />
              <Materi
                img={require("../images/image3.jpg")}
                title="Neuroscience"
                desc="Leonardo Oliveira"
                harga="10 Lessons"
                button="php"
                color="#9177F5"
              />
              <Materi
                img={require("../images/image1.jpg")}
                title="Human Evolution"
                desc="Joslin Rodgers"
                harga="10 Lessons"
                button="react"
                color="#5C4CEB"
              />
              <Materi
                img={require("../images/image2.jpg")}
                title="Genetic Models"
                desc="Kita Chihoko"
                harga="10 Lessons"
                button="music"
                color="#95D354"
              />
              <Materi
                img={require("../images/image3.jpg")}
                title="Catalytic Conversions"
                desc="Svyatoslav Taushev"
                harga="10 Lessons"
                button="medicine"
                color="#603DBB"
              />
              <Materi
                img={require("../images/image1.jpg")}
                title="Quantum Computers"
                desc="Ivan Cornejo"
                harga="10 Lessons"
                button="nodejs"
                color="red"
              />
            </Container>
          </Container>
        </Container>
      </Container>
    );
  }
}

export default Courses;
